                </div>
                <h2 style=""text-align:center""><b>Welcome To Java course</b></h2>
                <hr />
                <div>
                    <h1 class=""text-primary"">Java Operators</h1>
                </div><br>

                <div>

                    <p>Operators are used to perform operations on variables and values.</p>
                    <p>In the example below, we use the + operator to add together two values:</p><br>
                    <p><span class=""text-info"">int</span> x  =  <span class=""text-danger""> 45 + 50</span>;</p><br>
                    <p>The name of the java file must match the class name. When saving the file, save it using the class name and add "".java"" to the end of the filename. To run the example above on your computer, make sure that Java is properly installed</p>
                    <p>Although the + operator is often used to add together two values, like in the example above, it can also be used to add together a variable and a valu");
                WriteLiteral(@"e, or a variable and another variable:</p><br>
                    <p><span class=""text-info"">int</span> sum1 = <span class=""text-danger""> 45 + 50</span>;</p>
                    <p><span class=""text-info"">int</span> sum2 = sum1 + <span class=""text-danger""> 50</span>;</p>
                    <p><span class=""text-info"">int</span> sum3 = sum1 + sum2;</p><br>
                    <p>Java divides the operators into the following groups:</p><br>
                    <ul class=""list-group"">
                        <li>Arithmetic operators</li>
                        <li>Assignment operators</li>
                        <li>Comparison operators</li>
                        <li>Logical operators</li>
                        <li>Games</li>
                        <li>Bitwise operators</li>
                    </ul>
                    <br>
                    <h1 class=""font-weight-bold"">Arithmetic Operators</h1><br>
                    <p>Arithmetic operators are used to perform common mathematical oper");
                WriteLiteral(@"ations.</p><br>
                    <table class=""table table-bordered table-striped"">
                        <tr>
                            <th>Operator</th>
                            <th>Name</th>
                            <th>Description</th>
                            <th>Example</th>
                        </tr>
                        <tr>
                            <td>+</td>
                            <td>Addition</td>
                            <td>Adds together two values</td>
                            <td>x + y</td>
                        </tr>
                        <tr>
                            <td>-</td>
                            <td>Subtraction</td>
                            <td>Subtracts one value from another</td>
                            <td>x - y</td>
                        </tr>
                        <tr>
                            <td>*</td>
                            <td>Multiplication</td>
                            <td>Multiplies t");
                WriteLiteral(@"wo values</td>
                            <td>x * y</td>
                        </tr>
                        <tr>
                            <td>/</td>
                            <td>Division</td>
                            <td>Divides one value by another</td>
                            <td>x / y</td>
                        </tr>
                        <tr>
                            <td>%</td>
                            <td>Modulus</td>
                            <td>Returns the division remainder</td>
                            <td>x % y</td>
                        </tr>
                        <tr>
                            <td>++</td>
                            <td>Increment</td>
                            <td>Increases the value of a variable by 1</td>
                            <td>++x</td>
                        </tr>
                        <tr>
                            <td>--</td>
                            <td>Decrement</td>
                          ");
                WriteLiteral(@"  <td>Decreases the value of a variable by 1</td>
                            <td>--x</td>

                        </tr>
                    </table>
                    <br>
                    <h1 class=""font-weight-bold"">Java Assignment Operators</h1><br>
                    <p>Assignment operators are used to assign values to variables.</p><br>
                    <table class=""table table-bordered table-striped"">
                        <tr>
                            <th>Operator</th>
                            <th>Example</th>
                            <th>Same As</th>
                        </tr>
                        <tr>
